import React from "react";
import { Accordion, ListGroup } from "react-bootstrap";
import { Link } from "react-router-dom";

const MobileFooterNav = () => {
    return (
        <Accordion defaultActiveKey="1" flush className="bg-danger">
            <Accordion.Item eventKey="0">
                <Accordion.Header>
                    More about E-Shop
                </Accordion.Header>
                <Accordion.Body>
                    <ListGroup variant="flush" className="border-0">
                    <a href="/" className="list-group-item list-group-item-action">
                        A second link item</a>
                        <ListGroup.Item action href ='/'>ABOUT US</ListGroup.Item>
                        <ListGroup.Item action href ='/'>POLICY</ListGroup.Item>
                        <ListGroup.Item action href ='/'>FAQs</ListGroup.Item>
                        <ListGroup.Item action href ='/'>CONTACT</ListGroup.Item>
                        <ListGroup.Item action href ='/'>JOIN US</ListGroup.Item>
                    </ListGroup>
                </Accordion.Body>
            </Accordion.Item>
        </Accordion>
    )
}

export default MobileFooterNav;
